import {useContext } from "react";
import { Context } from "../Context/Context";

function Home (){

    const {dispatch} = useContext(Context);


    const handleLogout = () => {
        dispatch({type:"LOGOUT"});
    }

    return(
        <>
            
            <button onClick={handleLogout} >
                Log Out
            </button>
        </>
    )
}
export default Home;
